import React from 'react';
import './App.css';
import ListOfImages from "./technologies/images";
import {Input} from "nav-frontend-skjema";

function App() {
    return (
        <div className="App">
                <ListOfImages/>
                <Input/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
        </div>
    );
}

export default App;
